sys_variable_value.value:
(function execute(inputs, outputs) {
var grp = inputs.group
if (grp == '')
{
	outputs.res_grp_read = "NA"
    outputs.res_grp_write = "NA"
}
else if (grp != '')
{
	outputs.res_grp_read = grp
    outputs.res_grp_write = grp
}

})(inputs, outputs);

